import React from "react";
import "ExpensesList.css";
import ExpenseItem from "./ExpenseItem";

const expenseList = (props) => {
  const notFound = <p style={{ color: "white" }}>No expenses found.</p>;

  if (props.items.length > 0 && year !== "none") {
    return props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  } else if (props.year === "none") {
    return;
  }

  return (
    <div>
      <ul className="expenses-list">
        {props.items.map((expense) => (
          <ExpenseItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        ))}
        ;
      </ul>
    </div>
  );
};

export default expenseList;
